import React from "react";

export default function Topbar() {
  return (
    <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
      <div>
        <div style={{ fontSize: 24, fontWeight: 800 }}>Dashboard</div>
        <div style={{ color: "#666" }}>Resumen general del sistema Sentinel AI</div>
      </div>
      <div style={{ display: "flex", gap: 10, alignItems: "center" }}>
        <input
          placeholder="Buscar..."
          style={{ padding: "10px 12px", borderRadius: 12, border: "1px solid #e5e7eb", width: 260 }}
        />
        <div style={{ width: 36, height: 36, borderRadius: 999, background: "#111827" }} />
      </div>
    </div>
  );
}
